        merkleRoot = merkleRoot;
    }

    function setMerkleRoot(bytes32 _merkleRoot) public onlyOwner {
        merkleRoot = _merkleRoot;
    }

    function verifyWhitelist(bytes32[] memory _merkleProof, address _signer) public view returns (bool){

    }
}

